/**
 * EpubViewer wrapper style
 */
const styles: {
  boxSizing: any;
  margin: any;
  width: any;
  height: any;
  overflowY: any;
  fontFamily: any
} = {
  boxSizing: 'border-box',
  margin: '0px auto',
  width: '100%',
  height: '100%',
  overflowY: 'hidden',
  fontFamily: 'Fira code !important',
};

export default styles;
